Here is a simple example of a React, Node, and Express.js web app that creates, adds, and displays dummy data.

**Step 1: Create a new React app**

Run the following command in your terminal:
```bash
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node and Express.js server**

In the `my-app` directory, create a new file called `server.js`. Add the following code to this file:
```javascript
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let dummyData = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
];

app.get('/api/data', (req, res) => {
  res.json(dummyData);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  dummyData.push(newData);
  res.json(dummyData);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code sets up an Express.js server that listens on port 3001. It also defines two API endpoints: one to retrieve the dummy data, and one to add new data.

**Step 3: Create a React component to display the data**

In the `my-app` directory, create a new file called `DataList.js`. Add the following code to this file:
```javascript
import React, { useState, useEffect } from 'react';

function DataList() {
  const [data, setData] = useState([]);
  const [newData, setNewData] = useState({ name: '', age: 0 });

  useEffect(() => {
    fetch('http://localhost:3001/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  const handleSubmit = (event) => {
    event.preventDefault();
    fetch('http://localhost:3001/api/data', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newData),
    })
      .then(response => response.json())
      .then(data => setData(data));
  };

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>{item.name} ({item.age})</li>
        ))}
      </ul>
      <form onSubmit={handleSubmit}>
        <label>
          Name:
          <input type="text" value={newData.name} onChange={(event) => setNewData({ ...newData, name: event.target.value })} />
        </label>
        <label>
          Age:
          <input type="number" value={newData.age} onChange={(event) => setNewData({ ...newData, age: event.target.value })} />
        </label>
        <button type="submit">Add</button>
      </form>
    </div>
  );
}

export default DataList;
```
This code defines a React component that displays the dummy data and allows the user to add new data.

