In this example, the `background` property is added to the card's `style` object, and the `color` property is set to `#FF0000`, which is a red color.

Alternatively, you can also use a `container` element to wrap the card's content and apply a background color to the container:
```
{
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "type": "AdaptiveCard",
  "version": "1.0",
  "body": [
    {
      "type": "Container",
      "style": {
        "background": {
          "color": "#FF0000" // red background color
        }
      },
      "items": [
        {
          "type": "TextBlock",
          "text": "Hello World!"
        }
      ]
    }
  ]
}
```
In this example, a `Container` element is added to the card's `body` array, and the `style` property is applied to the container. The `items` property is used to add the `TextBlock` element to the container.

