package main

import (
    "context"
    "fmt"
    "log"
    "net"
    "sync"

    "github.com/miekg/dns"
)

func main() {
    pc, err := net.ListenUDP("udp", &net.UDPAddr{Port: 53})
    if err != nil {
        log.Fatal(err)
    }
    defer pc.Close()

    handler := dns.HandlerFunc(func(w dns.ResponseWriter, r *dns.Msg) {
        msg := dns.Msg{}
        msg.RecursionDesired = true
        msg.Id = r.Id
        msg.Qdcount = r.Qdcount
        msg.Answer = r.Answer
        msg.Ns = r.Ns
        msg.Arcount = r.Arcount

        for _, q := range r.Question {
            msg.Question = append(msg.Question, dns.Question{Name: q.Name, Qtype: dns.TypeA, Qclass: dns.ClassINET})
        }

        in, err := dns.Exchange(context.Background(), "8.8.8.8:53", &msg)
        if err != nil {
            log.Printf("Error forwarding request: %v", err)
            return
        }

        for _, ans := range in.Answer {
            w.WriteMsg(ans)
        }
    })

    server := &dns.Server{Handler: handler, Listener: pc}
    log.Fatal(server.ListenAndServe())
}
```

