        String[] options = {
            "A) Go to the forest",
            "B) Go to the mountain",
            "C) Go to the river"
        };

        // Define the corresponding actions for each option
        String[] actions = {
            "You are now in the forest.",
            "You are now in the mountain.",
            "You are now in the river."
        };

        // Display the dialogue options
        System.out.println("You are at a crossroads. Where do you want to go?");
        for (int i = 0; i < options.length; i++) {
            System.out.println(options[i]);
        }

        // Get the user's choice
        System.out.print("Enter your choice (A, B, or C): ");
        String choice = scanner.nextLine().toUpperCase();

        // Validate the user's choice
        int index = -1;
        for (int i = 0; i < options.length; i++) {
            if (options[i].startsWith(choice)) {
                index = i;
                break;
            }
        }

        // Perform the corresponding action
        if (index != -1) {
            System.out.println(actions[index]);
        } else {
            System.out.println("Invalid choice. Please try again.");
        }
    }
}
